import * as actionType from './ActionTypes'

export const ACTION_LOAD_CATEGORIES = {
    type : actionType.LOAD_CATEGORIES,
    payload : {
        categories : undefined
    }
}
export const ACTION_ADD_CATEGORY = {
    type : actionType.ADD_CATEGORY,
    payload : {
        category : undefined
    }
}
